    return (
        <>
        <div className="flex items-center justify-center space-x-4 pt-8">
        <input className="border border-black" type="text" value={city} onChange={(event) => {setCity(event.target.value)}}/>
        <button onClick={searchCity} className="text-white bg-gradient-to-br from-green-400 to-blue-600 hover:bg-gradient-to-bl focus:ring-4 focus:outline-none focus:ring-green-200 dark:focus:ring-green-800 font-medium rounded-lg text-sm px-5 py-2.5 text-center mr-2 mb-2">Search City</button>
      </div>
        </>
    )
}
